local function RGB_Picker(Red, Green, Blue)
	local slice_red = 64*max(min(Red or 0, FRACUNIT), 0) >> FRACBITS
	local slice_gre = 64*max(min(Green or 0, FRACUNIT), 0) >> FRACBITS
	local slice_blu = 64*max(min(Blue or 0, FRACUNIT), 0) >> FRACBITS

	local red_green_mix = (slice_red+slice_gre) >> 1
	local green_blue_mix = (slice_gre+slice_blu) >> 1
	local blue_red_mix = (slice_blu+slice_red) >> 1

	local x = (((red_green_mix+green_blue_mix+blue_red_mix)*64)/85) % 255
	local y = (slice_red+slice_gre+slice_blu) >> 1 - max(slice_red+slice_gre+slice_blu-64, 0) >> 2

	return LUT_HSL_table[max(min(y, 64), 0)][max(min(x, 255), 0)]	
end

